edia.org\/wiki\/1679\" class=\"mw-redirect\" title=\"1679\">1679<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u043e\u043c<\/a> \u043f\u0440\u0438\u043d\u044f\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%B1%D0%B5%D0%B0%D1%81_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81_%D0%B0%D0%BA%D1%82\" title=\"\u0425\u0430\u0431\u0435\u0430\u0441 \u043a\u043e\u0440\u043f\u0443\u0441 \u0430\u043a\u0442\">\u0437\u0430\u043a\u043e\u043d \u0425\u0430\u0431\u0435\u0430\u0441 \u041a\u043e\u0440\u043f\u0443\u0441<\/a> (\u0417\u0430\u043a\u043e\u043d \u043e \u043d\u0435\u043f\u0440\u0438\u043a\u043e\u0441\u043d\u043e\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438, Habeas Corpus Act), \u043e\u0434\u0438\u043d \u0438\u0437 \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0445 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043e\u043d\u043d\u044b\u0445 \u0430\u043a\u0442\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1707\" class=\"mw-redirect\" title=\"1707\">1707<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%B8%D1%81%D0%BF%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e\">\u0412\u043e\u0439\u043d\u044b \u0437\u0430 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0435 \u043d